import * as React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import CheckCircleIcon from '@mui/icons-material/CheckCircle';
import Error from '@mui/icons-material/Error';

const PageTwo = ({ data = [] }) => {
  const processImage = (src) => {
    return new Promise((resolve, reject) => {
      var request = new XMLHttpRequest();
      request.open('GET', src);
      request.responseType = 'blob';

      request.onload = function () {
        if (request.status === 200) {
          const img = new Image();
          img.src = src;
          resolve({ width: img.width, height: img.height });
        } else {
          resolve({});
        }
      };

      request.send();
    });
  };

  const createRow = async (row) => {
    const newImg = await processImage(row.url);

    // newImg
    //   .then((imgObj) => {
    //     console.log('imgObj', imgObj);
    //     return { width: imgObj.width, height: imgObj.height };
    //   })
    //   .catch(() => {});

    console.log('newImg', newImg, newImg.width);

    if (!newImg.width || !newImg.height) {
      return (
        <TableRow
          key={row.id}
          sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
        >
          <TableCell>
            <Error color="disabled" fontSize="large" />
          </TableCell>
          <TableCell component="th" scope="row">
            {row.id}
          </TableCell>
          <TableCell align="right">Bad Image</TableCell>
        </TableRow>
      );
    }

    return (
      <TableRow
        key={row.id}
        sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
      >
        <TableCell>
          <CheckCircleIcon color="success" fontSize="large" />
        </TableCell>
        <TableCell component="th" scope="row">
          {row.id}
        </TableCell>
        <TableCell align="right">{row.name}</TableCell>
        <TableCell align="right">
          {/* {newImg.width} x {newImg.height} */}
        </TableCell>
        <TableCell align="right">
          <img
            src={row.url}
            alt={row.name}
            width="200px"
            // loading="lazy"
          />
        </TableCell>
      </TableRow>
    );
  };

  return (
    <TableContainer component={Paper}>
      <Table
        sx={{ minWidth: 650, maxWidth: 800, margin: '0 auto' }}
        aria-label="simple table"
      >
        <TableBody>{data.map((row) => createRow(row))}</TableBody>
      </Table>
    </TableContainer>
  );
};

export default PageTwo;
